import React, { useContext } from "react";
import { Link } from "react-router-dom";
import {
    AppBar,
    Toolbar,
    Typography,
    makeStyles,
    Button,
    ThemeProvider,
} from "@material-ui/core/";
import themeNav from "../../config/themeNav";

import mapaContext from "../../contex/mapa/mapaContex";

const useStyle = makeStyles((theme) => ({
    offset: {
        ...theme.mixins.toolbar,
        marginBoton: "1rem",
    },
    title: {
        flexGrow: 1,
        color: "#FFF",
        paddingLeft: 2,
    },
}));

const Navbar = () => {
    const contextMapa = useContext(mapaContext);
    const { enRegistro } = contextMapa;

    const classes = useStyle();
    return (
        <ThemeProvider theme={themeNav}>
            <AppBar position="fixed" color="primary">
                <Toolbar>
                    <Typography variant="h6" className={classes.title}>
                    <Button href = "/">
                            Ã‘amomarandu
                        </Button>
                    </Typography>

                    {!enRegistro ? (
                        <Button variant="text" color="light" href = "/student">
                            Registrarse
                        </Button>
                    ) : null}
                </Toolbar>
            </AppBar>
            <div className={classes.offset}></div>
        </ThemeProvider>
    );
};

export default Navbar;
